import React from 'react';
import './Header.css';

function Header() {
  return (
    <header className="head">
      <nav className="navigation">
        <div className="logo">
          <a href="/" onClick={() => window.scroll(0, 0)} className="logotype">
            KinoLux
          </a>
        </div>
        <ul className="nav-list">
          <li className="list-item">About</li>
          <li className="list-item">TOP-10</li>
          <li className="list-item">Comedy</li>
          <li className="list-item">Sign in/</li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
